import React, { useRef } from 'react';
import { FiSearch } from 'react-icons/fi';
import { Column } from 'react-table';

import Header from '@/components/Header';
import Select from '@/components/Select';
import SEO from '@/components/SEO';
import Sidebar from '@/components/Sidebar';
import Table from '@/components/Table';
import Title from '@/components/Title';
import { Box, Button, Flex, Text, Tooltip } from '@chakra-ui/core';
import { FormHandles } from '@unform/core';
import { Form } from '@unform/web';

interface IFormData {
  email: string;
  password: string;
}

const GENERAL = [
  {
    Header: <Text color="#f33">Mês</Text>,
    accessor: 'month',
  },
  {
    Header: <Text color="#4169e1">% Físico acumulado previsto</Text>,
    accessor: 'estimated_cumultative_physics',
  },
  {
    Header: <Text color="#f33">% Físico Acumulado Executado</Text>,
    accessor: 'cumulative_physics_executed',
  },
  {
    Header: <Text color="#4169e1">% Físico Mensal Previsto</Text>,
    accessor: 'expected_monthly_physical',
  },
  {
    Header: <Text color="#f33">% Físico Mensal Executado</Text>,
    accessor: 'physical_monthly_executed',
  },
  {
    Header: 'Desvio físico',
    accessor: 'physical_deviation',
  },
  {
    Header: <Text color="green.400">Obra adiantada (em dias)</Text>,
    accessor: 'performed_monthly_physicist',
  },
] as Column[];

const SUMMARY_OF_AHEAD_ACTIVITIES = [
  {
    Header: <Text color="#4169e1">Item</Text>,
    accessor: 'item',
  },
  {
    Header: <Text color="#4169e1">Atividades Adiantadas</Text>,
    accessor: 'late_activities',
  },
  {
    Header: <Text color="#4169e1">% Prev. Até a data</Text>,
    accessor: 'prev',
  },
  {
    Header: <Text color="#4169e1">% Real. Até a data</Text>,
    accessor: 'real',
  },
] as Column[];

const SUMMARY_OF_LATE_ACTIVITIES = [
  {
    Header: <Text color="#f33">Item</Text>,
    accessor: 'item',
  },
  {
    Header: <Text color="#f33">Atividades Atrasadas</Text>,
    accessor: 'late_activities',
  },
  {
    Header: <Text color="#f33">% Prev. Até a data</Text>,
    accessor: 'prev',
  },
  {
    Header: <Text color="#f33">% Real. Até a data</Text>,
    accessor: 'real',
  },
] as Column[];

const Dashboad: React.FC = () => {
  const formRef = useRef<FormHandles>(null);
  return (
    <>
      <SEO
        title="Lafe"
        image="og/boost.png"
        shouldExcludeTitleSuffix
        description="Fazer Dashboad na plataforma"
      />

      <Header />

      <Sidebar />

      <Box as="main" maxWidth="100vw" paddingTop={64}>
        <Table
          data={[
            {
              month: <Text color="#f33">set-20</Text>,
              estimated_cumultative_physics: <Text color="#4169e1">05%</Text>,
              cumulative_physics_executed: <Text color="#f33">56,85%</Text>,
              expected_monthly_physical: <Text color="#4169e1">3,94%</Text>,
              physical_monthly_executed: <Text color="#f33">8,27%</Text>,
              physical_deviation: '8,43%',
              performed_monthly_physicist: <Text color="green.400">34</Text>,
            },
          ]}
          columns={GENERAL}
        />
      </Box>
    </>
  );
};

export default Dashboad;
